  if(window.PROMO_TEXT) {
    window.PROMO_TEXT.fixGradients = function() {
      $('.promo .pattern-bg').each(function() {
        var clzes = this.className.split(/\s+/);
        for(var i=0;i<clzes.length;i++) {
          if(clzes[i].indexOf('gradient') > 0) {
            var style = getStyle("."+clzes[i]);
            if(style.indexOf('-gradient') == -1) continue;
            var grad = /.*?\{(.*?)\}.*/.exec(style)[1];
            grad = grad.replace(/\s*background(-.+?)?:\s*/,'');
            grad = grad.trim();
            var color = '';
            if(grad.indexOf('rgb') == 0) {
              var ec_idx = grad.indexOf(')')+1;
              color = grad.substring(0,ec_idx);
              grad = grad.substring(ec_idx);
              //console.log("Found Color" , color);
            }
            var pp_idx = grad.indexOf('))');
            if(pp_idx > -1) {
              var t_color = grad.substring(pp_idx+2).trim();
              //console.log("Test Color", t_color);
              if(t_color.indexOf('rgb')>-1 && t_color.indexOf(')') > 10) {
                //console.log("Active Test Color", t_color);
                color = t_color;
              }
              grad = grad.substring(0, grad.indexOf('))')+2);
            } else {
              console.warn("Failed To Parse Gradient CSS: ",grad);
            }
            var bimg = $(this).css('background-image');
            var new_css = bimg + ', ' + grad;
            //if(color !== '') new_css += ' '+color;
            //console.log("New CSS: ", new_css);
            $(this).css('background-image', new_css);
          }
        }
      });
    };
    window.PROMO_TEXT.fixGradients();
  }
    // Click List Code Formatting
    $(".tab-container .code > pre").each(function() {
      var code = $(this).text().trim();
      if(!code) return;
      code = code.replace(/\s/g, "");
      // pull off everything before first '{'
      var first_bits = "";
      var curl_idx = code.indexOf('{');
      if(curl_idx != 0) {
        first_bits = code.substring(0,curl_idx);
        code = code.substring(curl_idx);
      }
      try {
        code = JSON.parse(code);
      } catch(e) {
        console.warn("Invalid or not JSON Sample Code: "+$(this).text());
        return;
      }
      $(this).html(
          first_bits + JSON.stringify(code, null, 2)
      )
    });

  if(window.CMP_WIDGET) {

    var CMP = window.CMP_WIDGET;
    CMP.filters = [];
    CMP._change = function() {
      var filter = '';
      if(CMP.filters.length == 1) filter = CMP.filters[0];
      else filter = $('select[name="comparison"] option:selected').val();
        //console.log('changed');
      CMP.drawTable(filter);
    };
    CMP.initSelect = function () {
      var cmp_select = $('select[name="comparison"], select[name="comparison-mobile"]');
      for (pkg in CMP.data) {
        var pkg_name = CMP.data[pkg].IndustryType;
        if (!CMP.filters.includes(pkg_name)) CMP.filters.push(pkg_name);
      }
      if (CMP.filters.length == 1) {
        cmp_select.parent().remove();
      } else {
        for (fil in CMP.filters) {
          var fil_name = CMP.filters[fil];
          cmp_select.append('<option value="' + fil_name + '">' + fil_name.substring(2) + '</option>');
        }
      }
      cmp_select.change(CMP._change);
    };

    CMP.drawTable = function (itype) {
      var packages = []; // full package object
      // unique subitems by name
      var unique_items = [];
      var pkg_index = {};
      for (p in CMP.data) {
        var pkg = CMP.data[p];
        if (pkg.IndustryType !== itype) continue;
        packages.push(pkg);
        var subs = pkg.SubItems;
        for (s in subs) {
          var name = subs[s].ItemName;
          if (!pkg_index[name]) pkg_index[name] = [pkg.PackageName];
          else if (!pkg_index[name].includes(pkg.PackageName)) {
            pkg_index[name].push(pkg.PackageName);
          }
          if (unique_items[name]) continue;
          unique_items[name] = subs[s];
        }
      }

      var i;
      // Create Table Header Row
      var headrow = $('table tr.cmp-header-row');
      headrow.empty();
      headrow.append('<th></th>');
      for (i = 0; i < packages.length; i++) {
        headrow.append('<th class="' + packages[i].TileHeaderColor + '">' + packages[i].PackageName + '</th>');
      }
      // Add a row with a single data for each unique item
      var body = $("table tbody.cmp-tbody");
      body.empty();
      for (n in unique_items) {
        var elm = '<tr data-iname="' + unique_items[n].ItemName + '"><td class="service-name">';
        elm += '<span class="has-tip" data-tooltip="' + unique_items[n].ItemDescription + '">';
        elm += unique_items[n].ItemName + '</span></td></tr>';
        body.append(elm);
      }

      // Add check marks or blanks in the rest of the data
      $('tr[data-iname]').each(function (idx, elm) {
        elm = $(elm);
        var name = elm.data('iname');
        for (i = 0; i < packages.length; i++) {
          if (pkg_index[name].includes(packages[i].PackageName)) {
            elm.append('<td><i class="icon-lg-bullet"></i></td>');
          } else {
            elm.append('<td></td>');
          }
        }
      });

      // Additionals are weirdly on all packages
      var a_services = $('.row .additional-services');
      if (packages[0] && packages[0].AdditionalItems) {
        for (a in packages[0].AdditionalItems) {
          var item = packages[0].AdditionalItems[a];
          var elm = '<div class="small-12 medium-6 large-4 columns item">';
          elm += '<span class="has-tip" data-tooltip="' + item.ItemDescription + '">';
          elm += item.ItemName + '</span></div>';
          a_services.append(elm);
        }
      }

      // Add pricing text row
      body.append($('<tr class="price-text"><td></td></tr>'));
      var price_row = $('tr.price-text');
      for (i = 0; i < packages.length; i++) {
        var element = '<td class="price-text">';
        var price_text = packages[i].PriceText;
        if (price_text.indexOf('$') > 0) {
          var pt = price_text.split('$');
          element += pt[0] + '<span class="' + packages[i].TileHeaderColor + '">&#36;' + pt[1] + '</span></td>';
        } else {
          element += price_text + '</td>';
        }
        price_row.append(element);
      }
      //$('.row.comparison table .has-tip').foundation();
      //$('.row .additional-services').foundation();
    };

    // Comparison Widget Table Building
    CMP.initSelect();
    CMP._change();
  }

