function effectiveDeviceWidth() {
  var o = window.orientation;
  var deviceWidth = (typeof o !== 'undefined' && o == 1) ? window.screen.height : window.screen.width;
  // iOS returns available pixels, Android returns pixels / pixel ratio
  // http://www.quirksmode.org/blog/archives/2012/07/more_about_devi.html
  //if (navigator.userAgent.indexOf('Android') >= 0 && window.devicePixelRatio) {
  //  deviceWidth = deviceWidth / window.devicePixelRatio;
  //}
  if(deviceWidth > (window.innerWidth + 128)) {
    return window.innerWidth;
  } else {
    return deviceWidth;
  }
}

/**
 * Gets styles by a classname
 *
 * @notice The className must be 1:1 the same as in the CSS
 * @param string className_
 */
function getStyle(className_) {

  var styleSheets = window.document.styleSheets;
  var styleSheetsLength = styleSheets.length;
  for(var i = 0; i < styleSheetsLength; i++){
    var classes = styleSheets[i].rules || styleSheets[i].cssRules;
    if (!classes)
      continue;
    var classesLength = classes.length;
    for (var x = 0; x < classesLength; x++) {
      if (classes[x].selectorText == className_) {
        var ret;
        if(classes[x].cssText){
          ret = classes[x].cssText;
        } else {
          ret = classes[x].style.cssText;
        }
        if(ret.indexOf(classes[x].selectorText) == -1){
          ret = classes[x].selectorText + "{" + ret + "}";
        }
        return ret;
      }
    }
  }

}

"use strict";
var exporter = {};

var tester = /^[-!#$%&'*+\/0-9=?A-Z^_a-z{|}~](\.?[-!#$%&'*+\/0-9=?A-Z^_a-z`{|}~])*@[a-zA-Z0-9](-?\.?[a-zA-Z0-9])*\.[a-zA-Z](-?[a-zA-Z0-9])+$/;
// Thanks to:
// http://fightingforalostcause.net/misc/2006/compare-email-regex.php
// http://thedailywtf.com/Articles/Validating_Email_Addresses.aspx
// http://stackoverflow.com/questions/201323/what-is-the-best-regular-expression-for-validating-email-addresses/201378#201378
function validate(email)
{
	if (!email)
		return false;
		
	if(email.length>254)
		return false;

	var valid = tester.test(email);
	if(!valid)
		return false;

	// Further checking of some things regex can't handle
	var parts = email.split("@");
	if(parts[0].length>64)
		return false;

	var domainParts = parts[1].split(".");
	if(domainParts.some(function(part) { return part.length>63; }))
		return false;

	return true;
}
exporter.validate = validate;

function validate_async(email, callback)
{
    var isValidEmail = false;
    try {
        isValidEmail = exporter.validate(email);
        callback(null, isValidEmail);
    }
    catch(err) {
        callback(err, isValidEmail)
    }
}
exporter.validate_async = validate_async;

module.exports = exporter;
